window.bookSummaryJSON = "<p>When Miss Elizabeth Waterstone encounters the enigmatic Duke of Diable Delamere in the most shocking of circumstances, she is determined to exploit his rakish expertise to the fullest extent. The duke agrees to teach her everything she needs to know but in return expects to receive her unwitting cooperation to uncover an assassination plot against the monarchy. But Elizabeth is hard to deceive, and the duke finds himself needing more than her innocent skills in his bed. Together they must use their remarkable abilities to thwart a villain, save the Prince Regent, and accidentally and inevitably fall in love. </p>"; 
